6031	vmlsudheendra@gmail.com	vmlsudheendra@gmail.com	\N	2017-09-05 10:05:22.681612	the ted talk is about balancing our emotions. when we achieve something good, we become happy and this state of happiness doesn't stay for a longer time. meanwhile, when we are depressed with any situation we faced, we tend to resist our mind to move on with the bad phase. we continue to be depressed for a longer time. after many experiments, it was concluded that people are more tilted towards the negatives than the positives that happen in our day to day lives. because of this, even though there are few instances which made our day better, we mostly forget them and recollect the bad things that happened to us. this increases the state of depression. instead, we can talk about the things that dint go in our way and share them with others. this reduces our sadness. additionally, you can also talk about the few good things that happened in the day. Also talking more about the things which gave us happiness rather than the things which made us feel low, would boost our happiness and make us feel better that the day was not that bad. we need to work hard and put up some effort to overcome these difficulties. 	712.15999999999997	0	submitted	2017-09-05 10:05:22.681618	301	301	Writing	TOEFL Exam 05-09-2017	10.10.10.3
