6118	arijit.mukherjee142228@gmail.com	arijit.mukherjee142228@gmail.com	\N	2017-09-05 10:07:35.602214	The speaker, Allison Ledgerwood speaks about the psychology of taking in gains and losses and how the situation affects our productivity.  She tells us how a simple change in the way of accepting the truth can actually alter the state of mind.\n\nUsually if we look at how one person can transition from a depressed state of mind to a happy state, takes a lot of time. People don't go back and forth changing their state of mind that easily and it takes a lot of effort.  The talk accounts for these changes by telling us about a few examples. How they put situations across a group of people and how they reacted.  Though, the outcomes were obvious it just shows how we can be emotionally affected.\n\nTo overcome this situation, she suggests looking at the good things that we have in our life because it boosts our mental health and productivity.  She goes even as far as to explain the same kind of situation in her life and how her husband helps lessen it. 	383.10899999999998	0	submitted	2017-09-05 10:07:35.602223	301	301	Writing	TOEFL Exam 05-09-2017	10.10.8.178
