6281	arshithpatel.d@gmail.com	arshithpatel.d@gmail.com	\N	2017-09-05 10:13:00.86017	The talk is about how people think by a social psychologist named Allison Ledgerwood. She talks about how people are tilting towards the negative side rather than accepting the positive things in life. She explains it with her personal example. As a social psychologist her week generally revolves around publishing papers. Whenever a paper is accepted she goes into a gain frame and feels elated. But when she faces a rejection, she dives into a loss frame and it takes a while for her to comeback to normal life. She says that, if she succeeds she is elated for a time. But in the face of defeat or a rejection her mind tends to tilt towards negative thoughts for a longer duration as compared to the situation where she is successful. She explains this behavior is because of the natural tendency of human mindset to tilt towards a negative emotion rather than a positive emotion. She also gives various other examples involving her casual talk with her husband in the evening and other examples including some people in the observation.  	594.41399999999999	0	submitted	2017-09-05 10:13:00.860179	301	301	Writing	TOEFL Exam 05-09-2017	10.10.10.3
