6255	ksrs9312@gmail.com	ksrs9312@gmail.com	\N	2017-09-05 10:12:00.855327	The talk above is regarding how people think, and how we might be able to think better.\nThe speaker explains that people's thinking is inherently tilted towards the negative, meaning that when people hear news that is negative, they are more likely to retain the negativity, even when presented with the equivalent positives of the news.\nThe analogy that the speaker uses to explain this is the "glass half full" mindset. She calls the "half full" mindset the "gain frame", and the "half empty" mindset the "loss frame". She explains that when people encounter the loss frame, it is difficult to rebound to a gain frame due to the nature of our thinking. Difficult, but not impossible.\nThe reader continues saying that it is possible to "see the upside". But it takes work and practice. She states that "writing for a few minutes a day about things that we're grateful for can dramatically improve happiness, wellbeing, and health".	38.767000000000003	0	submitted	2017-09-05 10:12:00.855335	301	301	Writing	TOEFL Exam 05-09-2017	10.10.10.3
