6498	kommavarapubhavya@gmail.com	kommavarapubhavya@gmail.com	\N	2017-09-05 10:21:56.088277	Allison Ledgerwood is a social psychologist who talks about how people think. She tries to figure out how humans think and they might be able to think better. She says that when an idea is accepted it creates a positive influence on human's brain while an idea when rejected creates a negative influence on human's brain. The positive influence doesn't stay longer when compared to the negative influence. People tend to think about the negative influence for an extended period of time. The piece of information which was told in terms of gains caused positive effect which when retold in terms of loss caused a negative effect. But when the information which was told in terms of loss, when retold in terms of gain couldn't make much positive impact on human's brain. So Allison says, though humans tend to search for the cause of negative that had happened, people should retrain their brains to speak of positive things that had happened throughout the day rather than speaking of negative things that had happened. She concludes saying that by practice humans can achieve the power of being positive and cultivate positive thoughts in people around.	935.06799999999998	0	submitted	2017-09-05 10:21:56.088284	301	301	Writing	TOEFL Exam 05-09-2017	10.10.11.43
