12603	perni.pavani@gmail.com	perni.pavani@gmail.com	\N	2017-09-09 10:31:36.960499	Hiring an inexperienced worker at a higher salary or experienced worker at a higher salary  have their own benefits. If the candidate is a passed out from a reputed university i did rather hire him than an experienced employee.\n    The first reason being the reputation of the university. There are certain universities that are well known in their country for the best education they provide. So he will have very sound basics. Even if a person is experienced, we cannot tell by his resume whether his experience is actually real or not. Instead of hiring people i am not sure about i would for the other option.\n     The second is the difference in the salary expectation. I can hire almost two inexperienced persons for the same amount of salary that i am expected to offer an experienced person. Say, i hired the experienced person he will have to take up the entire work burden that comes with his post and at some point ,he will complain about having to overwork. But with inexperienced people , i could split the work between both of them, which could also increase the work morale.\n     The third one being the motivation. A fresher who is working for the first time has more motivation to work and learn. This might be because of the human tendency to show interest in unfamiliar.This dulls as the days go by because of the hectic life style or the job being routine.\n    In conclusion, i would hire an inexperienced worker over an experienced one because of the university reputation, difference in salary and motivation.	1399.29	0	submitted	2017-09-09 10:31:36.960504	301	301	Writing	TOEFL 09-09-2017	10.10.8.255
