12760	vijay.m2b@gmail.com	vijay.m2b@gmail.com	\N	2017-09-09 10:37:32.739127	Hiring can be a major headache and hence companies allocate specified people known as human resources to manage this task. That said, given a choice to select a worker at lower salary or an experienced worker at a higher salary, I for one would go with the one with lesser experience. Reason being, the highly experienced worker would have demands needing to be met and would take much of the company's equity. Some of the common demands might be a higher salary, a few days off, some type of status provided by the company, etc. Having said this, an experienced worker might prove to rake in more profits, and therefore be a good resource. We can hence hire a few experienced personal first, then hire the inexperienced and put them under the mentor ship of the experienced. This would firstly create less of a burden on the company itself. Secondly, since most of the work done is more or less a repetition, they can be trained efficiently and prove worthy for the company. Adding to this, the demands of the "inexperienced" aren't much, other than to have a safe and healthy environment. 	256.82600000000002	0	submitted	2017-09-09 10:37:32.73914	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
