12758	ksrs9312@gmail.com	ksrs9312@gmail.com	\N	2017-09-09 10:37:31.608382	Picking an employee is a tricky task, since you're not really choosing a person and giving them a role. You're choosing a person for a role. So, the choice of the person would depend on the role at hand.\nFor a mundane task that anyone could accomplish, it makes sense to minimize the expenditure and make do with a novice. But for a critical task, you have to go with experience. Take, for example, the roles of Software Developer, and Project Manager. The role of developer could be done by anyone with command on a programming language, or at least the ability to quickly learn it. But, for the role of Manager, you need someone who can interact with clients, keep team members in check, and keep everything functioning smoothly. That requires experience.\nBut, the counterargument might go, an inexperienced person is easier to teach, and that requires less effort. An experienced person, on the other hand, would arrive with lots of overconfidence and unwillingness to bend. While it is true that an inexperienced person is mouldable, they are also unprofessional, at least compared to the experienced.\nSo, it isn't really the choice of a person that decides whom to pick for which role. You must allow the role itself to dictate what kind of person is good enough to fill it.	493.89800000000002	0	submitted	2017-09-09 10:37:31.608386	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
