12902	alfredvivekp@gmail.com	alfredvivekp@gmail.com	\N	2017-09-09 10:44:16.892874	First of all, being an employer of a startup, and that of an established one are two different things. We have to keep in mind, certain things  which matters a lot in either of the type of company as the parameters change in terms of the growth of the company. So now, if I were an employer of a startup and the have to freshly recruit candidates based on their experience level and  salary expectations, then basically I would go with a blend of both categories, the ratio being 60:40, where 60% will be the inexperienced ones and 40% will be the count of the experienced ones with high salary. The reason behind this as I think is, as a startup the budget will be very much crisp so as to accommodate high salaried employees in the company, and that the budget has to be very effectively used in order to bring a drastic growth in the company. So a mix of 40 actively working brains and 60 learners(also adding up their effort), will bring out good results I believe. On the other hand, in case of a well established company I would rather prefer experienced candidates over the freshers as things have to go really well in order to maintain the reputation and goodwill of the company towards the clients. Its not that there wont be intake of freshers but then, the count of those will be less as compared to the experienced ones as the company has to keep up the pace with its competitors . Apart from these, the role of the job also matters for me as to whether the particular role requires any high skills or a mediocre will do the work. Keeping these aspects in mind I would go for the selection of the candidate.	975.56600000000003	0	submitted	2017-09-09 10:44:16.892878	301	301	Writing	TOEFL 09-09-2017	10.10.9.201
