12843	bgkmskpraveenmb@gmail.com	bgkmskpraveenmb@gmail.com	\N	2017-09-09 10:42:19.332961	If I am an employer, I would like to hire employee based on work and the present status of the company i.e whether the company is startup, or well established company with international projects.\nIf the company is startup, most of the company's projects are not hard, so it can be easy for a fresher to complete the task. Also, the budget of the small companies or startups are limited. So instead of hiring an experienced employee at high salary, hiring a worthy, inexperienced candidate with low salary is preferred. But, necessary precautions have to be taken before hiring an inexperienced employee. Because, a startup company's valuable asset is its reputation. So, in order to not spoil the company's reputation, the hired person should have necessary skills and have the ability to complete the task in the specified time. In order to do so, training for the employees have to be taken by the company. \nIf a company have enough budget and have the projects which are very hard and international, hiring an experienced employee will be the best option. Because, apart from having enough skills, an experienced candidate have already done all the necessary training and can able manage time and work effectively. As the projects in these companies require persons with these skills, it is a best option to hire experienced candidate.\nApart from company's budget and projects it have, there are other aspects such as the ability to withheld the confidential information, as the probability that experienced candidate will not reveal the information is higher than the inexperienced candidate.\nFinally, it always depends on the company's budget, projects in order to hire candidates. For a company with lower budget hiring an inexperienced employee is preferred and experienced candidate is preferred for multinational companies.	1480.328	0	submitted	2017-09-09 10:42:19.332968	301	301	Writing	TOEFL 09-09