13393	anucherlapalli@yahoo.com	anucherlapalli@yahoo.com	\N	2017-09-09 11:09:27.476749	As an employer, there are two things I would keep in mind to make this decision, the work for which I'm hiring for and the skill needed for it. If the work requires lot of skill and assuming that the experienced worker also has the skill that matches his years of work, I would hire the experienced worker at a higher salary. If a person has the ability that would honor the work that they are doing, that ability in turn could bring on double the profit that their salary is worth. For instance, if I'm looking for a brain surgeon, I would without doubt go for an experienced person to deal with it. \n\nHowever if the work doesn't need much skill to begin with, I would probably go with the inexperienced worker at a lower salary. In this case, I could save money and could probably give a chance for a person to gain experience. Experience is something that is gained with time, and if the work for which I'm hiring could afford to let a person learn, I would choose the inexperienced worker. Supposing I need a systems engineer for an IT project, I could take a chance to hire the inexperienced worker and let him learn along the way. \n\nTo conclude, my choice would depend on the skill that my work requires and if the person in question has it, rather than the salary I would have to give. At the end of the day, the result that a company has to show depends on the ability of those who make up the company. Good work yields good result and good result is always a step up the ladder for the company.	2024.5129999999999	0	submitted	2017-09-09 11:09:27.476754	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
