13683	vmlsudheendra@gmail.com	vmlsudheendra@gmail.com	\N	2017-09-09 11:22:07.432832	experience is a key thing to be noticed by any employer. experience of one person help others to overcome a similar problem with less difficulty. considering this situation, one experienced person can make at least three inexperienced person work more productively than he/ she is. however, its not easy to hire many experienced candidates for a low salary. you can always question if certain person's experience can improve the efficiency of the company.if the experience can really make some difference then, its always recommended to hire the person even if we have to pay him more. it is also important to have a clear idea on the requirement and the necessity of the employees. only then we can justify if the person of less experience can be hired or if it's really necessary to have an experienced person in the group who can lead to the success of the company.\nif i was an employer, i would probably prefer to hire an experienced person over an inexperienced candidate. though i have to pay him more, i dont need to waste my time in training an inexperienced person. instead, i can make use of that time to produce more efficient work from the experience of the other person. there is always a question if the inexperienced person doesn't perform after i invest a lot of money on him. in such cases, its always better to pay an experienced person. \n	1039.1880000000001	0	submitted	2017-09-09 11:22:07.432843	301	301	Writing	TOEFL 09-09-2017	10.10.8.146
