13690	arshithpatel.d@gmail.com	arshithpatel.d@gmail.com	\N	2017-09-09 11:22:40.438725	If I were an employer, I would select the candidate based on the value they bring to the organisation rather than the experience they have. Everyone believes experience can be an asset to us always. But, I like to differ in this thought. I would say interest without experience is always better than experience without interest. \nIn general terms, when we hire an experienced person, we need to adjust our goals with the mindset of the person. But, when we hire an inexperienced candidate, we can gradually train him to follow or ideology and create mutual benefits. Moreover, an experienced candidate can sometimes be more demanding and also maybe a bit of unresponsive or not completely excited by the job. But, when we hire an inexperienced candidate who is deserving, he definitely has the adrenaline for the job and participates actively in everything. \nEven in terms of compensation for the employee, an experienced person expects us to pay more even if he is not that interested in his work. But an interested and inexperienced person does the job very effectively at lower wage. \nTo conclude, I prefer to employee a deserving inexperienced candidate rather than an experienced uninterested candidate. 	874.471	0	submitted	2017-09-09 11:22:40.43873	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
