13713	akhil.dh2@gmail.com	akhil.dh2@gmail.com	\N	2017-09-09 11:24:59.518737	Being an employer requires responsibility and matured thinking. The biggest dilemma faced by all the employers is to either hire an inexperienced guy with a lower salary or an experienced worker with a higher salary. I would personally prefer skilled and experienced workers with higher salaries.\n\nThe general misconception among people is that inexperienced workers come at a lower cost but it's actually not completely true. Freshers won't have any work experience and they require training for some period of time which lasts for about six to twelve months, during which don't do any serious work. Being an employer I have to invest in their training and frankly speaking I would literally be paying them salaries for doing nothing. This whole process is waste of time and resources for the company which, as an employer, I wouldn't prefer.\n\nWhen we hire skilled and experienced workers, we can immediately assign them to important projects and this way we save a lot of time. Compared to inexperienced workers, people who have experience can solve problems more quickly and efficeintly as they might have faced them in the past. We have to pay more salaries to them but at the end of the day, I think it's worth the price we pay.\n\nAs I mentioned, an experienced person should also be skilled to get hired. If a fresher has more knowledge and skill than an experienced guy, then as an employer I would prefer the fresher. This is because he has the skill which when used properly by the company becomes an asset for the company and moreover he can be hired with a minimum wage.\n\nI would like to conclude that instead of employing an experienced guy without skill, we can hire skilled freshers and experienced workers.	1257.721	0	submitted	2017-09-09 11:24:59.518741	301	301	Writing	TOEFL 09-09-2017	10.10.10.136
