13741	phaneendrakasanur@gmail.com	phaneendrakasanur@gmail.com	\N	2017-09-09 11:28:18.668665	In my opinion an experience worker is a better hire. an experience brings experience in a particular area and this is an advantage to the company. Investing  higher salary on experience  is acceptable as it would improve the quality of the company. \nThere are many advantages in hiring employees over inexperienced. the cost of training would be less. the experienced employee can teach employees with lesser experience as they will be more up to date about the developments in concerned area  .compared to inexperience employees they can navigate through many situations and know how to deal with if a difficult problem arises.  even if their salary is high they bring profits in long term basis. there are some disadvantages too,like employees are less open to change of technology with respective to newer employees. \nThere are some benefits of employing worker with lesser experience as it would save money for the company but we have to training them in the particular technology in order to do projects. even after all the training , there is no surety the employee will be with company. \nIn conclusion, i can say that hiring employees based on their experience is an advantage as it would boost the teams morale.	2051.1790000000001	0	submitted	2017-09-09 11:28:18.668675	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
