14171	rsrisai12@gmail.com	rsrisai12@gmail.com	\N	2017-09-09 11:43:33.525858	If I were an employer my choice of preference would be dependent on two important factors, one is time and other is money. Hiring an inexperienced worker can save money. But, the perks of having an experienced worker in the are more. And because of this reason, I would definitely hire an experienced worker even at a high salary. \nYes, hiring workers at low salary can save a lot of money for the company. But, the lack of inexperience can make them do errors which affect the company tremendously. Also, they are not experienced in taking instant decisions, which is very vital for any company. And a wrong decision can cost a fortune for the company.\nSome may say that proper training can make an inexperienced worker better. But training an individual from the basics and making him/her cope with other workers is a wastage of a lot of resources. Even after that, there is no guarantee that the person won't leave to the other company for a better pay.\nAbove all by hiring an experienced worker can make a huge difference when it comes to team projects. He/she can easily mingle with the fellow workers with out any hesitation and start the work from day 1. Also, an experienced worker doesn't always need guidance or instructions, which is a huge relief for me as a manager.\nIn conclusion, I believe that hiring an experienced worker is worth the cost. As they don't need training, they will not commit silly errors, Instead, their experience can improve the reputation of the company.\n\n\n 	2397.297	0	submitted	2017-09-09 11:43:33.52587	301	301	Writing	TOEFL 09-09-2017	10.10.11.103
