13999	narayanagunturi@outlook.com	narayanagunturi@outlook.com	\N	2017-09-09 11:39:55.594172	Choosing an employees is critical to the functioning of the company. When an unsuitable employee gets hired, the resources we pour into that person goes to waste. That is why we need to be careful when hiring.\n \nAgain, the compatibility of an employee with the company also depends on the company's requirements. If the company needs vast human resources and operates on software on which people can be easily trained, then as an employer I wold prefer to hire an inexperienced worker at a lower salary. As the an inexperienced person can be easily trained in such a software the company not only gets trained employees but also the vast human resources that it needs to accomplish its tasks.\n\nIf the company works on complicated software such as angular JS or node.JS,  technologies  in which expertise and efficiency only comes with prior experience I would hire a person at higher salary. It doesn't matter how many people we hire if they are not capable of accomplishing the task within the given time. So, in these cases it is better to employ employees who have  expertise and prior experience in these technologies.\n\nWhat if a company works on both complicated  and relatively easy technologies. In such a case it is in the best of interest of the company to hire experienced people at a higher salary and to outsource the work which involves relatively easy tech. By outsourcing I mean to form a contract with some other company to do your work. You can do the complicated work while they do the easy work for you. Why not the other way around? Because the cost of developing complex technologies is really huge when compared to that of its counterpart. And more over the cost of hiring many people to do an easy job becomes really high.\n\nThus I would choose my employee from the given categories or not choose one at all depending on my company's needs.   \n\n 	1312.213	0	submitted	2017-09-09 11:39:55.594187	301	301	Writing	TOEFL 09-09-2017	10.10.11.220
