14364	srivaniv1245@gmail.com	srivaniv1245@gmail.com	\N	2017-09-09 11:54:27.222696	According to my experience i would like to hire an experienced worker at a higher salary.I like to use following reasons to explain why i am hire.\nThe first and important reason is that experienced workers themselves mean higher efficiency. I remembered the words "Time is money" . Most of factories follow this system. Most of employees gave interest to money. They will work for money. We have to catch their experience and we have to give money back to them. Because of experienced people we get the most benefits to the company.\nI have another equally important reason to choose experienced people that is, They don't want much training. They know from basics. For example if a factory hire inexperienced candidates they have give training to them and later only they do work. But if thy hire experienced people they save time for training in that time they can do more for work for company. \nOn other hand, for situations when more knowledge skills is crucial for a job. I would tend to hire someone who have more experienced and would rather pay more salary. Now people gradually know that experienced people get more knowledge rather than inexperienced people.Such as ,many famous companies prefer to provide more attractive welfare than other companies in order to get their ideal talents .\nComing to my conclusion there are many other reasons to that should be considered, i rather hire an experienced candidate at a higher salary than employ an inexperienced worker at lower salary.	1176.463	0	submitted	2017-09-09 11:54:27.222703	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
14371	vijay.m2b@gmail.com	vijay.m2b@gmail.com	\N	2017-09-09 11:55:04.904855	Hiring can be a major headache and hence companies allocate specified people known as human resources to manage this task. That said, given a choice to select a worker at lower salary or an experienced worker at a higher salary, I for one would go with the one with lesser experience. Reason being, the highly experienced worker would have demands needing to be met and would take much of the company's equity. Some of the common demands might be a higher salary, a few days off, some type of status provided by the company, etc. Having said this, an experienced worker might prove to rake in more profits, and therefore be a good resource. We can hence hire a few experienced personal first, then hire the inexperienced and put them under the mentor ship of the experienced. This would firstly create less of a burden on the company itself. Secondly, since most of the work done is more or less a repetition, they can be trained efficiently and prove worthy for the company. Adding to this, the demands of the "inexperienced" aren't much, other than to have a safe and healthy environment. 	1.127	0	submitted	2017-09-09 11:55:04.904863	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
