14381	ajaykrishna.ayyala@gmail.com	ajaykrishna.ayyala@gmail.com	\N	2017-09-09 11:55:17.273276	There is a saying that "Old is Gold". But I believe it doesn't work in all the cases. There is need for fresh thoughts instead of always going in a conventional approach. If I am an employer I would mostly prefer a young graduate over an experienced professional.\n\nThe main reason behind this is the fresh graduates show immense interest in learning new things, as the technology is constantly changing day by day this will be of greater advantage. On the other hand for experienced people it would be tedious job to shift to a newer technology as they got accustomed with a technology which they had mastered.   \n\nSecondly, they are energetic, adaptable and have a zeal to work. For example in my case, at my previous workplace the amount of work what we do is almost double that of the experienced people. According to a study the capability to learn will loose over the age. If we have a situation where the employee has to relocate to a new place it will be difficult for him while its not the same in case of a young graduate.\n\nMoreover, the cost to the company of having an a fresher is far less than having an experienced person. It is always cheaper to train a fresher than hiring an experienced professional. Till middle management level any organisation must provide room for young graduates.\n\nHowever, we have the other side also that the experienced person will be knowledgeable and can be of a great help to the organisation. I believe that the benefits of having a fresher into the organisation are more. Finally I would like to say that the experienced professionals must join their hands with the freshers and work towards the welfare of the organisation.	2743.415	0	submitted	2017-09-09 11:55:17.27328	301	301	Writing	TOEFL 09-09-2017	10.10.8.92
