14417	smgousesair19@gmail.com	smgousesair19@gmail.com	\N	2017-09-09 11:56:52.178355	If I were an employer I would prefer hiring an experienced worker at a higher salary rather than an inexperienced worker at a lower salary.\n\nThere are different reasons for hiring an experienced worker. Firstly an experienced worker can produce a high-quality product than an inexperienced worker. Even if he takes a higher salary than an inexperienced person he produces the good with the quality of that caliber. Consider an example of a restaurant. In the restaurant, the workers should be of higher experience or the quality and the taste of the food doesn't satisfy the customers. If the restaurant starts losing its customer then the owner has to close the restaurant. If the worker is an experienced person then he can help other workers if they have any problems.\n\nSecondly, if we hire an inexperienced worker we need to train the said person. which according to will be an additional investment on the worker which doesn't have the guarantee that the extra time and money spent or invested on the untrained worker can be recollected from his work or not. And while training the inexperienced person if there are any accidents the additional costs are spent by the owner. even if it can be recollected from the worker the amount first should be paid by the owner.\n\nSo it will better to hire an experienced worker at a higher salary rather than hiring an inexperienced worker with a lower salary.	1055.107	0	submitted	2017-09-09 11:56:52.178365	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
