14370	devarakondasuraj19@gmail.com	devarakondasuraj19@gmail.com	\N	2017-09-09 11:54:53.181097	The hiring of a worker depends on the type of job and the abundance of workers. For small jobs, it is not necessary to hire workers of highly experienced, but for a sensitive job, it is important to hire well qualified and experienced person. \nWe think that hiring an inexperienced worker at a lower salary is better. But it actually costs more if you are required to teach or make him understanding the work. In some case, as the worker is not familiar with the work he might commit some mistakes and which in turn results in us a major problem. But we might consider hire him if he/she has a good knowledge and was able to work hard to train.\nAn experienced worker at a higher salary would be better because he might do a job many people alone and able to identify the problem if any occurs and it's easier for him to solve that. This would be advantages in many cases and reduce the cost of bringing external people for solving it.\nIf the availability of workers if less then we have no choice of choosing but to hire those who come. Over all, It depends on the type of job we are considering and availability of workers who are interested to work in that field.\n\n	2925.73	0	submitted	2017-09-09 11:54:53.181106	301	301	Writing	TOEFL 09-09-2017	10.10.8.148
