14411	mm.nebulae@gmail.com	mm.nebulae@gmail.com	\N	2017-09-09 11:56:16.811264	If I were an employer I would hire people based on the requirements of the job. If the job requires a specific skill-set, finesse and experience, then it would obviously be beneficial for me to hire an experienced employee at a higher salary, especially since in the long run, the risks of hiring an inexperienced employee at a lower salary include the higher probability of him or her making a foolish mistake which might prove to be fatal to my company. \nOn the contrary, if the fresher had enough technical knowledge and is backed with a good academic record, then I might prefer taking him instead of an experienced employee with just an average track record. In this case, my perspective as the employer would be that training the fresher with a good academic record might yield a productive technically skilled employee who will remain loyal to my company in the future.\nIn either case, at the end of the day, the number of years of working experience is just that- a number- what ultimately determines my hiring preferences as the employer are the job requirements and the skill-set of the employee, although technical knowledge, personal attitude and the academic record of the employee might also play a huge role in my decision.	2770.2860000000001	0	submitted	2017-09-09 11:56:16.81127	301	301	Writing	TOEFL 09-09-2017	10.10.11.115
