14526	alekhya.gamini24@gmail.com	alekhya.gamini24@gmail.com	\N	2017-09-09 12:06:09.746988	according to my opinion both candidates are eligible.for instance take an inexperienced person,he has no experience but may be he have good knowledge of subject and work,may he have creative and innovative ideas of how to increase output.experience is never parameter to take candidate into consideration.it is requirement of designation about having experience or not.it is not like experience person is always correct, may be an experience person follows old methods in work which gives output but takes more time to yield,while on other side an inexperienced person work in innovative way which yield output of work faster but with slight faulty, so never judge person ability by experience, instead give preference to both candidates equally.combine them and their works together,make experienced person as a guide to new worker,so that both learn from each other. new worker learn to do work without mistakes, while old worker learns to work faster.see around our recent changes in world,nowadays young people are developing their own startups which eventually turned into an leading organisations in some years.if they had support of an experienced person they will get gain earlier.not all startups are succeeded,those which are failure require an person to check it's errors responsible for this situation.an experienced person is like teacher,mentor to new people because he may had seen all ups and downs in profession, so he can judge correctly what is correct and what is wrong.he can predict easily consequences of particular work.he is well aware of all circumstances because he grown up by facing those situations.he may have good or bad  in his graph of career but most important parameter is experience.an experience person thinks wisely about what is important,which will give which output.he can easily handle any situation like 'DO OR DIE', whereas new worker will panic when he have to face problems. New worker is like box of new ideas according to new generation and changes in world, whereas experienced worker is like solution to every problem that arise,So we can get good results when these two work together. So in my view both experienced and inexperienced worker are prioritized.	1711.9780000000001	0	submitted	2017-09-09 12:06:09.746995	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
14554	vathsalya1994@gmail.com	vathsalya1994@gmail.com	\N	2017-09-09 12:08:05.404377	Selecting a worker is a tricky business.The worker should be obedient, hardworking and sincere.We can't hire someone who is not having one of the above qualities because we want  our work to be neat.Here experience does matter because we can't  teach each and everything to the worker.We need to watch out the time of hiring employees and workers because planning is everything and plan involves time and without planning we don't have a start.So, at a time of great need we need to hire someone who is well experienced and having certain amount of knowledge.Only then we will be able complete our work on time and submit it.But there will be times where the company needs someone who take out the stress.These are the times where someone does not need experience of work but the experience of talking to people.He or she should be able to talk the person or higher employee out of the topic that  is making the situation difficult and think in a way where the problem is substantiated.So, as it says necessity is the mother of invention a timely decision is more advisable than an opinion.I would hire someone depending upon the needs and requirements of the time.	1352.9839999999999	0	submitted	2017-09-09 12:08:05.404385	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
