14563	muralireddy319@gmail.com	muralireddy319@gmail.com	\N	2017-09-09 12:09:17.095046	I will hire a experienced worker at a higher salary rather than an inexperienced worker at a lower salary because I give  more importance to the quality of work rather than money. If we hire an inexperienced worker we should spend some money and time on his training which is again extra burden for the company, whereas in case of experienced worker he can directly get into work from day one itself. Also the inexperienced worker might make some mistakes in the work due to which you may have some losses and it may also damage the reliability of clients on the company.\n             The experienced worker can inspire other workers in the company to work more effectively. He will also have some knowledge about market conditions in the recent years, which can be used for the development of products which will be successful. In case of my absence he can handle the projects easily which will not be the case with inexperienced worker. As he already know the requirements of the job and there will be no problems in the future. For example if the job requires a person to work for long hours at times and go to new places frequently, the experienced person can easily mingle with these situations. In case of the inexperienced worker has never experienced such situations he may face some problems in the beginning. \n           Finally, an experienced worker can increase the quality of work and bring more profits for the company than the inexperienced worker. Even though it is more costly to have experienced worker, but if you consider above factors it is definitely beneficial to the company.	1381.8599999999999	0	submitted	2017-09-09 12:09:17.095053	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
14439	sharanya.marineni@gmail.com	sharanya.marineni@gmail.com	\N	2017-09-09 12:00:06.594371	If I was an employer, I would like select an employee who is an inexperienced worker at a lower salary. An employee need to have basic knowledge to enter into a company and that person need to have keen interest in learning new things to work efficiently.\nAn inexperienced worker who is a fresher, will have interest in learning new things. Fresher who came out of college doesn't have any practical knowledge, so he makes more effort in learning and enhancing skill for his development in the company. For example, if we take an employee who is inexperienced and if we train him on whatever skill we want for our project, then he will satisfy with his work for sure. Whereas, if we take an experienced worker then skill level is high and we can't make him work with what we want to do in our project. \nIn India, we are presently facing an issue regarding unemployment of young graduates. Many students have been suffering a lot after getting out college due to companies not taking inexperienced workers. I think a fresher\nperforms well in a company and gives best results. I have seen many students going for job fairs and walk-ins, but only some people get jobs because of the skill lacking of person and other thing is companies won't take people who are inexperienced. In order to less the unemployment in our country. We need to take inexperienced people and make them train to improve their knowledge.\nIf we take salary as aspect, giving less salary to a fresher and train them with good skill will be a benefit for that person as well as to the company.In this way we have a chance to employ fresh graduates and lessen unemployment rate.\nIn conclusion, in my opinion choosing an inexperienced worker will help the company and also our country in all aspects.	1922.9580000000001	0	submitted	2017-09-09 12:00:06.594376	301	301	Writing	TOEFL 09-09-2017	10.10.10.196
