e problems. New worker is like box of new ideas according to new generation and changes in world, whereas experienced worker is like solution to every problem that arise,So we can get good results when these two work together. So in my view both experienced and inexperienced worker are prioritized, So i choose a person with good values and knowledge rather than thinking about experience.	112.16500000000001	0	submitted	2017-09-09 12:08:13.600198	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
