14596	muralireddy319@gmail.com	muralireddy319@gmail.com	\N	2017-09-09 12:11:08.481586	I will hire a experienced worker at a higher salary rather than an inexperienced worker at a lower salary because I will usually give  more importance to the quality of work rather than the money. If we hire an inexperienced worker we should spend some money and time on his training which is again extra burden for the company, whereas in case of experienced worker he can directly get into work from day one itself. Also the inexperienced worker might make some mistakes in the work due to which you may have some losses and it may also damage the reliability of clients on the company.\n             The experienced worker can inspire other workers in the company to work more effectively. He will also have some knowledge about market conditions in the recent years, which can be used for the development of products which will be successful. In case of my absence he can handle the projects easily which will not be the case with inexperienced worker. As he already know the requirements of the job and there will be no problems in the future. For example if the job requires a person to work for long hours at times and go to new places frequently, the experienced person can easily mingle with these situations. In case of the inexperienced worker has never experienced such situations he may face some problems in the beginning. \n           Finally, an experienced worker can increase the quality of work and bring more profits for the company than the inexperienced worker. Even though it is more costly to have experienced worker, but if you consider above factors it is definitely beneficial to the company.	69.361999999999995	0	submitted	2017-09-09 12:11:08.481592	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
