14471	prudhvik.1996@gmail.com	prudhvik.1996@gmail.com	\N	2017-09-09 12:01:44.188498	If I were an employer, I would choose a candidate based on their experience and knowledge as well. I personally have a strategy on how to recruit employees.\nWhen it comes to assessing a guy, a talented guy might not have a job experienc but might have worked on some projects before, or in any other form he might have applied his knowledge. This application of knowledge to create or improvise a project is what I need as an employer. \nAnd of course there are some other things like, maintaining human relations with colleagues, making himself adapt soon to the new projects and clients, getting comfortable to the corporate hierarchy, etc. It is obvious that a guy who has worked before will be well aware of all these things as he has already experienced.\nWhen it comes to recruiting, I would also consider the type of chair which is to be filled. A genius with great knowledge on technology would not be suitable for some kind of works like maintaining relations with clients, etc., and in the same way a guy with exceptionally good knowledge on human relations may not make a good engineer. And for the same chair, with the same kind of expertise in the required field, I would conduct an interview to test their adaptability to different situations. Then basing on those results, I would hire the best guy who would take less salary.\nI make this optimal selection of the person based on some factors like the type of the vacancy available, on how long will he work for me and on how well will this position add to him, because my employee getting benefitted is also important to me.	1958.991	0	submitted	2017-09-09 12:01:44.188502	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
