14589	prasadgopu1@gmail.com	prasadgopu1@gmail.com	\N	2017-09-09 12:11:00.193835	The burden of reaching success is carried by every employee working for a company. Especially, a person who is responsible for building the workforce of a company needs to be very cautious while recruiting a person. Various factors come into the picture for the recruiter while assessing a prospective candidate's profile. \nThe hierarchy represents the role,responsibilities and bluntly put, the pay grade of every employee working in the company. \nRecruiting a person with a high or low salary depends upon of the job description. So, as an employer, I would be more inclined to recruit a person with low salary for jobs that involve more of physical input rather than mental skills. In general, people with low salary can be fine tuned according to the company's requirement.  Also, they are more flexible and will be open to role shift, serving the company's need at the right time. It is also quite evident in some cases that this set of people, if given a chance to work, will feel blessed and stay loyal to the company. Adding to it, people under this category refrain themselves from questioning the authorities or the system.  And that doesn't give higher officials the right to imply unreasonable laws or rules on the any employee in a company.\nWith the responsibility of hiring efficient staff, I will go for an experienced worker if the role demands the handling of various departments or managing a group of people. Previous experience for an employee will help him/her manage serious issues more efficiently. So, it is acceptable to grant high salary to an employee if he/she is loaded with responsibilities which directly has an impact on the company.\nSo, salary for a prospective candidate depends on the role to which  he/she is applying.	2172.395	0	submitted	2017-09-09 12:11:00.193846	301	301	Writing	TOEFL 09-09-2017	10.10.8.13
