14565	muralireddy319@gmail.com	muralireddy319@gmail.com	\N	2017-09-09 12:09:39.890814	I will hire a experienced worker at a higher salary rather than an inexperienced worker at a lower salary because I give  more importance to the quality of work rather than money. If we hire an inexperienced worker we should spend some money and time on his training which is again extra burden for the company, whereas in case of experienced worker he can directly get into work from day one itself. Also the inexperienced worker might make some mistakes in the work due to which you may have some losses and it may also damage the reliability of clients on the company.\n             The experienced worker can inspire other workers in the company to work more effectively. He will also have some knowledge about market conditions in the recent years, which can be used for the development of products which will be successful. In case of my absence he can handle the projects easily which will not be the case with inexperienced worker. As he already know the requirements of the job and there will be no problems in the future. For example if the job requires a person to work for long hours at times and go to new places frequently, the experienced person can easily mingle with these situations. In case of the inexperienced worker has never experienced such situations he may face some problems in the beginning. \n           Finally, an experienced worker can increase the quality of work and bring more profits for the company than the inexperienced worker. Even though it is more costly to have experienced worker, but if you consider above factors it is definitely beneficial to the company.	18.323	0	submitted	2017-09-09 12:09:39.890825	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
14571	skeerthu96@gmail.com	skeerthu96@gmail.com	\N	2017-09-09 12:10:15.977512	The topic is about what type of worker would I prefer if I were an employer. I would hire an inexperienced worker at a lower salary rather than Hiring an experienced worker at higher salary. I would give reasons for it in the following passages.\nFirstly, I would take in to consideration his learning interest and capability in new topics. An experienced candidate even though he doesn't know the work in my office will be less interested to learn as he thinks he knows a lot through his past experience. An inexperienced candidate takes this as a challenge and proves him that he can be best in any work by showing more interest in learning and implementing it. As learning, grasping and executing are key important factors which I need in a worker in my company, I will prefer an inexperienced worker.\nSecondly, I want a worker to be sensible to others and help them when wanted. If I hire an inexperienced worker he while doing his work shows interest in helping others so gets to learn more and work more. As a result this directly helps my company to develop more.\nThirdly, an inexperienced worker is more flexible than experienced worker. As he is new to this type of environment I can mold him in a way that I want for the better development of me and my company.\nLastly, as inexperienced workers doesn't know the annual salary and many more things regarding them, they will not be able to rise or bargain salary. I can hire them up for my work with low salary. \nTo conclude, as i hire a worker for my company I take them to satisfy the need for the betterment of my company. So, I will definitely hire an inexperienced worker with low salary. \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n	680.23099999999999	0	submitted	2017-09-09 12:10:15.977519	301	301	Writing	TOEFL 09-09-2017	10.10.9.26
