14627	nikhitha.ghadiyaram@gmail.com	nikhitha.ghadiyaram@gmail.com	\N	2017-09-09 12:13:10.978945	As we know,We should prefer an experienced worker with high salary rather than an inexperienced worker with less salary.\nWe really want an employer to face everything which challenges him. This happens mostly with an experienced employer, as he would have experienced it before.\nFor example, if you give a task to an experienced and to an inexperienced employers, obviously an experienced employer would finish it first as he might have seen tasks like these before. But inexperienced employer would really take time to adjust, learn and implement the work in the task. \nFor another example, inexperienced employer might not know how to tackle a situation where there should be a quick response from our side to the clients, this is where experienced employers lead.\nAs we all know, when we enter a corporate world, we see experienced employers teaching inexperienced one's, about the technology or any kind of work it might be.\nBut on the other side, inexperienced people with good knowledge should also be considered because, they may try implementing works in new ways which can give higher efficiency but experienced workers might go with the same old way they know.\nTo sum up, experienced employers are once inexperienced employers, but the hiring criteria should depend upon how an employer can handle a situation or a task given to him. This gives a higher priority to experienced employer. 	1385.913	0	submitted	2017-09-09 12:13:10.978952	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
