14647	sukeshpabolu@gmail.com	sukeshpabolu@gmail.com	\N	2017-09-09 12:15:08.354829	As we all know that every person does not possess any experience or talents by birth. We also know that all the people with high experience or low experienced in their past. Due to this, I prefer to hire an inexperienced worker at a low salary. \nMany companies offer a higher salary to get experienced people and want to boost their performance at the starting of their development. But if we take long term scenarios. The development may not be dependent on those higher experienced workers. If we take a low experienced person with good knowledge and good skills, the initial development may be slow. But as the time progress as his experience increases, we can see the growth of the development. To keep them in the company for a long time. It will be enough to increase his or her salary slowly and there will be reliability in their work. Popular companies like Google, Microsoft keep changing their CEOs from time to time to ensure the reliability and development of the companies in the long run. \nSo I want to conclude by saying that every person has to start from somewhere. Thinking about present scenarios instead of future may not do well. Many start-ups became hit as they were hiring less experienced more talented workers.	767.39200000000005	0	submitted	2017-09-09 12:15:08.354835	301	301	Writing	TOEFL 09-09-2017	10.10.10.186
