14722	shravan.kumar090@gmail.com	shravan.kumar090@gmail.com	\N	2017-09-09 12:21:36.152914	According to me, if i was an employer i would prefer an experienced worker at a higher salary rather than an inexperienced worker at a lower salary. Every company needs a best employee for the progress to be the best, this would be happened only when the employees are experienced enough.\nFor example, if an employee is an inexperienced with a lower salary who works in a company, the training doesn't give him the whole experience the company needs. every aspect should be clearly explained to the employee so that he would be aware of every thing he should be doing in the company or projects. With this type of procedure the employers looses time in explaining him or her, and the salary payment is also an loss to the company as there is no outcome from the individual even the salary package is lower.\nIf an employee is experienced, he can be directly work for the projects without any training. With a such experience employee the company can be benefited in various ways, like he can help to his colleagues, mix with the company easily, can work effectively for the projects, which gives a good results to the company. If the company is benefited, there would not be any problem in giving a high package salary to such an experienced employee.\nTo conclude, the employee who is recruited with an experience can move easily with flow of the company without any flaw issues. So, preferring a experienced employee is the best option for the benefits of particular company, irrespective to the salary package.	2.8090000000000002	0	submitted	2017-09-09 12:21:36.15292	301	301	Writing	TOEFL 09-09-2017	10.10.11.153
