14706	lavotivinay@gmail.com	lavotivinay@gmail.com	\N	2017-09-09 12:19:04.67717	The answer depends on what type of company that I run.\nFew jobs need less time to be experienced while few others take a lot of time to learn the skill.\nIf I were to choose between inexperienced worker and experienced worker, I will choose the experienced one regardless of their salary expectations. \nI believe that the quality is more important than the quantity of the work. \n\nLets take an example of a printing press. There are at least 20-40 staff and their salary range is mediocre. The skill to operate the machines can be learnt within a month. It might take a maximum of 3-4 months depending upon person's intellectual ability.\nHere, there is no need for me to pick an experienced employee rather than a fresher because they may expect higher salary.\n\nLets take another example of website building. Website building cannot be done by everybody. Here, I need to pick an employee who has already done at least 7-10 websites in past which are perfect. When building a website, I need to make sure that all the client's requirement is met.\n\nSo, I believe both has their own gravity. But, I prefer experienced employees.	520.85199999999998	0	submitted	2017-09-09 12:19:04.677177	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
