14812	snehithabeechani@gmail.com	snehithabeechani@gmail.com	\N	2017-09-09 12:28:44.454857	If i was an employer, I would prefer choosing a combination of inexperienced and experienced employees as both of them have their own advantages. A company needs a combination of experienced and inexperienced to prosper well.\nThe future of the world always lies in the hands of the young generation, they have most innovative ideas. There are many cases where new, inexperienced employees came up with amazing ideas. Which resulted in easing many complicated tasks to a great extent. To put it in other way, we don't think much about renovating mundane tasks, we get habituated doing them in the same manner. While, someone who gets introduced to one of such tasks for the first time, might not be, so comfortable doing it in the same way. Eventually, he might come up with an idea to facilitate his work which might result in simplifying the job.\nSimilarly, experienced employees come with their own advantages. We learn  almost every thing in our life through experience. It is all those lessons we learn through our failures which nurture our knowledge.Experienced employees might have encountered various situations in their tenure, this exposure comes in hand when they have to handle certain vital situations.This is major drawback with inexperienced employees.\nIn a nutshell, I would prefer having a amalgam of experienced and inexperienced employees. So, that I can have the benefits associated with both fresh minds as well as experienced minds. This gives me the power to deal to with most of the situations and develop as a whole.	5.6040000000000001	0	submitted	2017-09-09 12:28:44.454864	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
