14711	sdrajaparthi@gmail.com	sdrajaparthi@gmail.com	\N	2017-09-09 12:20:33.52259	            Generally, I would like to insist an experienced worker rather than hiring an inexperienced worker . An inexperienced worker is one who doesn't have knowledge on the work in which you or an employer actually wants to. He has to know new things on how to manage the work life rather, it may be the first time to be in a work environment. It will be hard to cope with the people around him , it is hard to mingle with the colleagues for the first time as it shows the qualities which are important for an worker to hire. Moreover he has to get trained for the work he is to be assigned. Though there are many disadvantages  of having an inexperienced  worker as an employee, at certain times it may be advantageous as he or she may be clever and would be more helpful to the organisation or a company.\n            Whereas, having an experienced employee will shape the company or an organisation to a certain extent. We may persuade him or her by giving tasks that are tricky or handle projects with them without any fear. There is no need to provide excessive training as they get experienced to work  earlier and they might know how the work environment and the culture will be.It gets easy to handle with the people of different culture or of a different race. They are clever enough to handle tough situations.Though it may be tough for handling them with higher salaries, in order to get the best results out of it , it is mandatory to hire people who are experienced. It will also benefit the people or co-workers in our company to get more information about the work life. So finally I would like to insist an experienced person to hire.	696.76900000000001	0	submitted	2017-09-09 12:20:33.522594	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
