14969	gauravsingh13091990@gmail.com	gauravsingh13091990@gmail.com	\N	2017-09-09 12:45:06.423828	I would like to hire an inexperienced worker at lower salary\n\nInexperienced or naive employees don't mean they are stupid. Inexperienced employees means that they are not familiar with nature of work.There are lots of success stories in front of us who started as a naive employee or inexperienced employee later become CEO of that company for example. sunder pichai CEO of google at some point of time he also started as inexperienced person now  he is well known to whole world.\nI would like you to introduce with some of the benefits of hiring inexperienced worker\n. \nYou can always find a hunger to learn new things inside a  inexperienced worker. Reason for this is that everything is new for them so they will try to learn new things with great passion. \nEven studies suggests that  if we are learning new things, We will retain maximum portion of it in first time. Inexperienced young workers are energetic they can  work even after office hours with lots of energy lots of energy left in them,  If they feel that some task is pending. Inexperienced workers will take less salary and it will help the company to gain more profit.\nInexperienced  young workers  are  more familiar with new technologies so if  you are deciding to upgrade your company then you don't  have to look in the market to recruit new people. You can train them and use them accordingly. Even inexperienced workers are not much demanding. 	1547.7840000000001	0	submitted	2017-09-09 12:45:06.423843	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
14802	anveshbudhuri@gmail.com	anveshbudhuri@gmail.com	\N	2017-09-09 12:27:44.313244	It is an unsaid fact that a lot of work, effort and resources go into choosing a company's prospective employee. There are a lot of factors on which a person's selection into the family of a company depends, granted, but what is the factor which tips the scales in one's favor or against him? "Is it experience or talent?" is a debatable question. If I were the employer, I would probably be more inclined towards talent while considering a person's chances of selection than the salary I'd have to pay. A spice of experience would probably be an additional cherry on the cake.\n\nThere are numerous companies/organizations out here which play a gamble with peoples' careers. Companies, especially like start ups, have limited resources or funds. So, they would naturally be more inclined towards hiring a person with low experience as they are much more willing to offer their services at a lower price than the more experienced employees. This might seem beneficial on the superficial level but there are many risks to face in a more holistic view. For example, a small company's revenues might take a plunge because of one mistake of a greenhorn.\n\nThis problem, however, is not something you'd see frequently. Also, there is no guarantee that an experienced employee doesn't make mistakes. There are chances for it to happen as well, albeit much lesser than the fore-mentioned case. Thus, a person with more inherent talent can be hired to overcome these issues, most of the times. \n\nSo, to conclude, even though both, hiring a novice or an experienced person each have their own pros and cons, having to give the employees with higher experience more salaries as per demand can be seen as an investment rather than as an expense. In  the end, who gets into a company depends on the caliber of the person applying and the need of the company.	1912.3620000000001	0	submitted	2017-09-09 12:27:44.313252	301	301	