14879	naveen.teenu@gmail.com	naveen.teenu@gmail.com	\N	2017-09-09 12:35:44.37248	I expect both kinds of workers to be recruited because both of them have certain role to play in the company. Experienced workers directs the company and the inexperienced workers whereas we can expect much productive work from inexperienced workers with a lower salary.\n\nMy statement of hiring both employee's make a different sound but i can give you two better examples about both the workers to be hired.\n\nPrimarily, the experienced workers can be best compared to the engine of a train which directs the entire train in its way. Similarly, the experienced workers direct the work, inexperienced workers and the organization. They are tend to be one eye of the organization and their direction will be an big asset for the organization.\n\nNext, the inexperienced workers are said to be other eye of the organization. They are tend to work more for the company as the part of their growth in the company. They are in search of the knowledge and experience which make them to work for more hours. This makes the inexperienced workers to be more productive with a less salary. In this scenario, both the workers and employees are benefited. As the workers can gain experience and the company can have their production with a less investment.\n\nIn conclusion, i conclude that both the workers are equally important and have a important role in their organization's growth. I compare the experienced workers to be engine of the train and inexperienced workers to the compartments of the train. To make the passengers travel in a train, the compartments are needed and to make the train work,the engine is needed. Similarly for an organization, both the workers are needed to be a part of organization's growth.	1683.694	0	submitted	2017-09-09 12:35:44.372487	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
