14895	abhargav1994@gmail.com	abhargav1994@gmail.com	\N	2017-09-09 12:38:07.832654	Being an employer, I would try to choose a blend of fresher employees and experienced candidate for my company. Fresher mind is like a plain paper, full of ideas and they have lot of enthusiasm and zeal to learn novel things. They can come up with innovating methods of doing regular work. Suppose 20 fresher employees (inexperienced) are hired by a company, which means it has acquired 20 new ideas and more over the fresher people will be working to work at a lower salary as most of them will be looking for exposure and experience.\nOn the other hand experienced employees, the name itself conveys their importance. They have something very precious called experience which can be only acquired by working. They will be well aware of business situations and can help us in taking a correct step based on their previous such occurrences. They can lead the inexperienced employees and guide them in building their careers. As goes by a saying, everything comes at a price. We need to pay a little higher to acquire these people when compared to inexperienced resource.\nAnything in excess will lead to imbalance and instability. Same goes in the case of an organization also. If there are only fresher people, it might cause an utter chaos. And again if the company only hires experienced people, the company might fall short of innovative and new ideas. So a perfect ratio of these people is recommended for the success of the company.\n	2.1120000000000001	0	submitted	2017-09-09 12:38:07.832662	301	301	Writing	TOEFL 09-09-2017	10.10.10.58
