14819	avenkatesh1004@gmail.com	avenkatesh1004@gmail.com	\N	2017-09-09 12:29:26.466818	      If I were an employer then my first preference would be hiring an experienced person. Because, a company can survive only when the workers are able to understand and perform the task assigned to them within a specified time. Experienced workers will serve this purpose, as they previously had a work experience. For example, if i hire a person who don't have enough knowledge about the work then how could the company make profits. So, i think it's better to hire an experienced person. \n     In  my point of view an experienced worker can handle the situation in a better way than an inexperienced person. The main reason is he will have a knowledge about the task which is assigned to him. With that he can cleverly deal the situation whenever a problem is encountered. We know a fact that "Practice makes man's perfect", it sounds like a man can become perfect in any aspect, only when he does practice. I want to say that an experienced person can perform better than an inexperienced person.\n     Quality is the thing that gives an extra mile to the company's growth. But from where that quality comes, i think by hiring the experienced people. If I assign a task to an inexperienced candidate then i think there should be a backup in order to help him whenever he gets strucked and quality of the outcome cannot be expected from him. Here i want to convey quality of the outcome can be enhanced by hiring an experienced person.\n    Finally, hiring an experienced person will pave a way for the growth of company. An experienced person can perform better than an inexperienced person.It will be helpful in enhancing quality.I want to conclude it by saying that I would hire an experienced worker.	7.8079999999999998	0	submitted	2017-09-09 12:29:26.466825	301	301	Writing	TOEFL 09-09-2017	10.10.10.3
