14868	charan100reddy@gmail.com	charan100reddy@gmail.com	\N	2017-09-09 12:33:58.995705	If I were an Employer, I would choose the employee based on some deciding factors like size, turnover of the company and importance of the vacant job role.\n          For example, if the company has very fewer employees and the capital of the company is pretty good.I would prefer an experienced worker with a higher salary because the person who had higher salary before likely to have more talent than the other. The company also prefers to afford money to hire the brightest talent.\n          Suppose If the company has a large number of employees and the skill required to do that job is not much high.I would prefer an inexperienced person with a less salary because the company cannot afford extra money to an experienced person unnecessarily where the work requires not much of experience for doing that.The hired inexperienced person in future may learn many skills with in less time which in turn would be a benefit to the company.\n               If the company is financially very good and the vacant job requires high talent irrespective of experience, I would prefer a talented guy because the talent is given higher priority in the company irrespective of experience of the worker.The company can afford huge amounts for rare talents.\n        Finally, I would prefer an employee depending on the requirement of job skill and the financial capabilities of the company.	1.843	0	submitted	2017-09-09 12:33:58.995715	301	301	Writing	TOEFL 09-09-2017	10.10.10.54
14869	pothuganti1993@gmail.com	pothuganti1993@gmail.com	\N	2017-09-09 12:33:59.637762	  Being an employee to an organization it is my responsibility to strive for its growth.When I get a chance to select someone for organisation, I would select the candidate depending on the requirement and also keeping a track on the package payable to the candidate.\n\n  In some situations its better to hire an inexperienced and the one who would strive for the growth of the organisation, so that the person would get a chance to learn and  work for the company. Everything will not be known by everyone, it is just that if we are assigned with certain task it is our responsibility to complete it on time. In this case hiring an inexperienced is better.\n\n When we really require someone who could work with complex situations it is better to opt for an experienced candidate. the one with experience could handle the situations at ease when compared to inexperienced one. It does not mean that inexperienced one cannot handle the situations, they would also learn to tackle the situations eventually.\n   \n     Hiring an experienced candidate and an inexperienced candidate differ from one main reason that is, pay. The one with experience would expect more package from the organisation for all the work that person has done. \n\n   Recruiting an inexperienced or experienced is not important , the main important thing is choosing the right one for the organisation is important. Sometimes it happens that the with no experience might be highly talented when compared to the experienced candidate. So choosing them wisely is important for the sake of organisation.\n   \n \n 	1387.557	0	submitted	2017-09-09 12:33:59.637771	301	301	Writing	TOEFL 09-09-2017	10.10.11.18
